import React from 'react';

function NotifySwitchButton(props) {
    return (
        <>
            <div className = 'col-md-3 text-center offset-md-1' style = {{ cursor : "pointer" , border: "1px solid #ADADAD", backgroundColor : props.choose ? "#F0F0F0" : "white"}}>
                {props.text}
            </div>
        </>
    );
}

export default NotifySwitchButton;
